import { useState } from "react";

function SetAdmin() {
  const [admin, setAdmin] = useState(false);
  return (
    <div>
      <div className="set_admin_box">
        <div className="set_admin_title">관리자 설정</div>
        <div className="set_admin_contents">관리자 목록</div>
      </div>
    </div>
  );
}
export default SetAdmin;
